void iDFT_Software(float *ret, float vm, float *seno, float *coss){
    float tempo[N+1], tempoi[N+1];
    float s;
    int i,j;
    
    tempo[0] = 0;
    tempoi[0] = (float) 1/60;
    for(i=0; i < N; i++){
        
        s = (float) vm;
        for(j=0; j<H; j++){
            s += (float) (seno[j] * cos(2 * PI * ((j + 1) * 60) * tempo[i]) ) + (coss[j] * sin(2 * PI * ((j + 1) * 60) * tempo[i]));
        }
        ret[i] = (float) s ;
        
        tempo[i+1] = (tempo[i] + (float) (1.0 / (60 * 256)));        
        tempoi[i+1] = (tempoi[i] - (float) (1.0 / (60 * 256)));     
    }
}


void iDFT(float *ret, float vm, float *seno, float *coss){
    int i, j;
    
    for(i=0; i < N; i++){
        ret[i] = vm;
        for(j=1; j < H; j++){
            ret[i] += (coss[j] * (cos( (2 * PI * i * j) / N ) ) ) ;
            ret[i] += (seno[j] * (sin( (2 * PI * i * j) / N ) ) ) ;
        }
    }    
}

float DFT(float *data, float *seno, float *coss){
    int i, j;
    float vector[N];
    
    
    for(i=0; i<N;i++)
    {
        vector[i]= (float) ( (data[i]));// - 2080) / 116.18 );
    }
    
    for(i=0; i < H; i++)
        seno[i] = coss[i] = 0;
    
    for(i=0; i < N; i++){
        for(j = 0; j < H+1; j++ ){          
            coss[j] += (vector[i] * (cos( (2 * PI * i * j) / N ) ) ) ;
            seno[j] += (vector[i] * (sin( (2 * PI * i * j) / N ) ) ) ;
        }
    }
       
    for(j = 1; j < H; j++ ){          
        coss[j] = 2 * coss[j] / N;
        seno[j] = 2 * seno[j] / N;
    }
    return (float) (coss[0] / N) + (seno[0] / N);   
}

float* ComplexFFT(float *data, int sign)
{
    //variables for the fft
    unsigned long int n,mmax,m,j,istep,i;
    double wtemp,wr,wpr,wpi,wi,theta,tempr,tempi;
    float *vector;
    //the complex array is real+complex so the array
    //as a size n = 2* number of complex samples
    //real part is the data[index] and
    //the complex part is the data[index+1]
    //new complex array of size n=2*sample_rate
    //if(vector==0)
    //vector=(float*)malloc(2*SAMPLE_RATE*sizeof(float)); era assim, define estava em Capture.h
    vector=(float*)malloc(2*N*sizeof(float));
    memset(vector,0,2*N*sizeof(float));

    //put the real array in a complex array
    //the complex part is filled with 0's
    //the remaining vector with no data is filled with 0's
    //for(n=0; n<SAMPLE_RATE;n++)era assim, define estava em Capture.h

    for(n=0; n<N;n++)
    {
        if(n<N)
            vector[2*n]= (float) data[n];//( (data[n] - 2080) / 116.18 );
        else
            vector[2*n]=0;
        vector[2*n+1]=0;
    }

    //binary inversion (note that the indexes
    //start from 0 witch means that the
    //real part of the complex is on the even-indexes
    //and the complex part is on the odd-indexes)
    //n=SAMPLE_RATE << 1; //multiply by 2era assim, define estava em Capture.h
    n=N << 1; //multiply by 2
    j=0;
    for (i=0;i<n/2;i+=2) {
        if (j > i) {
            SWAP(vector[j],vector[i]);
            SWAP(vector[j+1],vector[i+1]);
            if((j/2)<(n/4)){
                SWAP(vector[(n-(i+2))],vector[(n-(j+2))]);
                SWAP(vector[(n-(i+2))+1],vector[(n-(j+2))+1]);
            }
        }
        m=n >> 1;
        while (m >= 2 && j >= m) {
            j -= m;
            m >>= 1;
        }
        j += m;
    }
    //end of the bit-reversed order algorithm

    //Danielson-Lanzcos routine
    mmax=2;
    while (n > mmax) {
        istep=mmax << 1;
        theta=sign*(2*PI/mmax);
        wtemp=sin(0.5*theta);
        wpr = -2.0*wtemp*wtemp;
        wpi=sin(theta);
        wr=1.0;
        wi=0.0;
        for (m=1;m<mmax;m+=2) {
            for (i=m;i<=n;i+=istep) {
                j=i+mmax;
                tempr=wr*vector[j-1]-wi*vector[j];
                tempi=wr*vector[j]+wi*vector[j-1];
                vector[j-1]=vector[i-1]-tempr;
                vector[j]=vector[i]-tempi;
                vector[i-1] += tempr;
                vector[i] += tempi;
            }
            wr=(wtemp=wr)*wpr-wi*wpi+wr;
            wi=wi*wpr+wtemp*wpi+wi;
        }
        mmax=istep;
    }
    //end of the algorithm

    for(i = 0; i < N*2; i++ ){          
        vector[i] = (float) ((2 * vector[i]) / N);
        
        if (i % 2 == 1)
            vector[i] = vector[i] * -1;
            
    }

    return vector;
}

